/**
 * Configuration type that is global across the PlayHQ platform. This information
 * includes the overarching sporting organisations, known as tenants, and their
 * corresponding sport that they govern.
 */
export type Configuration = {
  __typename?: 'Configuration';
  /** Returns ExternalAccountLinking configuration for all tenants. */
  externalAccountLinking?: Maybe<Array<ExternalAccountLinkingWithTenant>>;
  /**
   * The sports that the tenants govern over. The `name` is the human readable
   * representation and should be displayed to the user. The `value` is the
   * computed name, and should be used as GraphQL input when the query or mutation
   * requires it.
   */
  sports: Array<TenantField>;
  /**
   * Returns information about the countries we support for registration.
   * Includes mobile country code.
   */
  supportedCountries?: Maybe<Array<SupportedCountry>>;
  /**
   * The tenants name details. The `name` subfield is the human readable name
   * and should be displayed to the user, while the `value` is the computed
   * name, mainly used for scoping. Requests that require such scoping should
   * provide it in the header when the request is made.
   */
  tenants: Array<TenantField>;
  /**
   * The list of tenant slugs. The `name` field is a short name of the tenant
   * while value is a tenant slug. For example:
   * name: bv
   * value: basketball-victoria
   */
  tenantSlugs?: Maybe<Array<TenantField>>;
};

