/**
 * An upcoming team event timeline has two categories outlined in their field documentation.
 * Every `[UpcomingTeamEvent!]` is ordered by their date in ascending order. Byes dates are
 * determined by their round's provisional date. Due to how rounds only store the date,
 * these entries will be ordered before games.
 */
export type UpcomingTeamEventTimeline = {
  __typename?: 'UpcomingTeamEventTimeline';
  /**
   * Events have occurred recently (no more than 1 day ago), and events that are upcoming next
   * week are found here. Most events will be allocated games of any status and some byes.
   * Byes are represented as `DiscoverRound`.
   *
   * Bookmarked entries that would result in duplicated entries are removed. Duplication is
   * determined by the type of event and the team. For example, if a user follows two teams
   * that would play against one another, the game would be duplicated.
   * Byes act differently as their identity is compounded by their round ID and the team.
   * If the user follows multiple teams that share a bye (i.e., these teams are having byes
   * on the same round), a record for each team will be given.
   */
  recentAndNextWeekEvents: Array<UpcomingTeamEvent>;
  /**
   * Upcoming events outside the week range specified above will reside in this type. Every
   * bookmarked team should have one element in this list. Games may be allocated or unallocated.
   * View the `UpcomingTeamEventItem` union type documentation for more details.
   */
  upcomingEvents: Array<UpcomingTeamEvent>;
};

export type UpcomingTeamEvent = {
  __typename?: 'UpcomingTeamEvent';
  event: UpcomingTeamEventItem;
  team: DiscoverTeam;
};

/**
 * An upcoming team event can be comprised of different events expressed in this union
 * type. The type return is based from the following rules:
 *
 * DiscoverGame is used when:
 *
 * - When the team is playing in an allocated game
 * - When the team is playing in an unallocated game. The `allocation` field resolver
 * should return `null` in this case.
 *
 * DiscoverRound is used when:
 *
 * - If the team has a bye
 *
 * EmptyTeamEvent is used when the conditions met in the its type documentation are found.
 */
export type UpcomingTeamEventItem = DiscoverGame | DiscoverRound | EmptyTeamEvent;

/**
 * Represent an team event that acts like a terminator, i.e., the last event for a team
 * in the timeline. This event can represent the following:
 *
 * - A team is in an event that exceeds round visibility.
 * - A team is not allocated to a grade
 * - A team is allocated to a grade with no fixture.
 */
export type EmptyTeamEvent = {
  __typename?: 'EmptyTeamEvent';
  reason?: Maybe<EmptyTeamEventReason>;
};

export enum EmptyTeamEventReason {
  HiddenByRoundVisibility = 'HIDDEN_BY_ROUND_VISIBILITY',
  NoFixtureAvailable = 'NO_FIXTURE_AVAILABLE',
  NoUpcomingGames = 'NO_UPCOMING_GAMES'
}

