export type ClaimProfileInput = {
  claimProfileID: Scalars['ID'];
  id: Scalars['ID'];
  /**
   * This field is used only for self initiated profile claiming, specifically
   * for claiming profiles that should be classed as dependants under the account
   * holder who should be the same as the authenticated profile.
   *
   * This should be set to true when the following intent is expressed from the user:
   *
   * - The authenticated user (also known as the account holder thereafter) wants to
   * claim a profile as a new dependent.
   * - The account holder knows the personal details of the dependent and submits them
   * as override fields
   *
   * When this field is true, the `id` field of `ClaimProfileInput` should be the same
   * as the account holder's profile ID while the `claimProfileID` should be the disjointed
   * dependant profile ID.
   *
   * This field should not be provided and will be ignored if the `registrationCode`
   * is also supplied.
   */
  isClaimingNewDependant?: InputMaybe<Scalars['Boolean']>;
  method?: InputMaybe<ClaimMethod>;
  registrationCode?: InputMaybe<Scalars['String']>;
};

export enum ClaimMethod {
  Email = 'EMAIL',
  Mobile = 'MOBILE'
}

